import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import { MainNav } from './components/layout/Header';
import { AccountSetup } from './views/accountSetting/SettingsPage';
import { UploadPhotos } from './views/accountSetting/UploadPhotos';
import { Dashboard } from './views/dashboard/Dashboard';
import Homepage from './views/landing/Homepage';
// import Homepage from ''

// const Homepage = lazy(() =>
//     import ("./views/landing/Homepage"))

function App() {
    return ( 
    <>
        <Switch>
            <Route path="/"
            exact component={Homepage}
            />   

            <Route path="/accountsettings" exact render={() => (
                <>
                    <MainNav />
                    <AccountSetup />
                </>
            )} />
            <Route path="/uploadphotos" exact render={() => (
                <>
                    <MainNav />
                    <UploadPhotos />
                </>
            )} />

            <Route path="/dashboard" exact render={() => (
                <>
                    <Dashboard />
                </>
            )} />


        </Switch> 
        </>
    );
}

export default App;
